-- ----------------------------
--  Records of `ebay_condition_id`
-- ----------------------------
BEGIN;
INSERT INTO `ebay_condition_id` VALUES ('1', '1000', 'New', 'A brand-new, unused, unopened, unworn, undamaged item. Most categories support this condition (as long as condition is an applicable concept).'), ('2', '1500', 'New other (see details)', 'A brand-new new, unused item with no signs of wear. Packaging may be missing or opened. The item may be a factory second or have defects.'), ('3', '1750', 'New with defects', 'A brand-new, unused, and unworn item. The item may have cosmetic defects, and/or may contain mismarked tags (e.g., incorrect size tags from the manufacturer). Packaging may be missing or opened. The item may be a new factory second or irregular.'), ('4', '2000', 'Manufacturer refurbished', 'An item in excellent condition that has been professionally restored to working order by a manufacturer or manufacturer-approved vendor. The item may or may not be in the original packaging.'), ('5', '2500', 'Seller refurbished', 'An item that has been restored to working order by the eBay seller or a third party who is not approved by the manufacturer. This means the seller indicates that the item is in full working order and is in excellent condition. The item may or may not be in original packaging.'), ('6', '3000', 'Used', 'An item that has been used previously. The item may have some signs of cosmetic wear, but is fully operational and functions as intended. This item may be a floor model or store return that has been used. Most categories support this condition (as long as condition is an applicable concept).'), ('7', '4000', 'Very Good', 'An item that is used but still in very good condition. No obvious damage to the cover or jewel case. No missing or damaged pages or liner notes. The instructions (if applicable) are included in the box. May have very minimal identifying marks on the inside cover. Very minimal wear and tear.'), ('8', '5000', 'Good', 'An item in used but good condition. May have minor external damage including scuffs, scratches, or cracks but no holes or tears. For books, liner notes, or instructions, the majority of pages have minimal damage or markings and no missing pages.'), ('9', '6000', 'Acceptable', 'An item with obvious or significant wear, but still operational. For books, liner notes, or instructions, the item may have some damage to the cover but the integrity is still intact. Instructions and/or box may be missing. For books, possible writing in margins, etc., but no missing pages or anything that would compromise the legibility or understanding of the text.'), ('10', '7000', 'For parts or not working', 'An item that does not function as intended and is not fully operational. This includes items that are defective in ways that render them difficult to use, items that require service or repair, or items missing essential components. Supported in categories where parts or unworking items are of interest to people who repair or collect related items.');
COMMIT;

